export class User {
    usuario: string;
    nombre: string;
    apellido: string;
    rut: string;
    correo: string;
    carrera: string;
    telefono: string;
    region: string;
    direccion: string;
  
    constructor(
      usuario: string,
      nombre: string,
      apellido: string,
      rut: string,
      correo: string,
      carrera: string,
      telefono: string,
      region: string,
      direccion: string
    ) {
      this.usuario = usuario;
      this.nombre = nombre;
      this.apellido = apellido;
      this.rut = rut;
      this.correo = correo;
      this.carrera = carrera;
      this.telefono = telefono;
      this.region = region;
      this.direccion = direccion;
    }
  }
